// src/components/Dashboard.js
import React from 'react';

const Dashboard = () => {
  return (
    <div className="container mt-5">
      <h2>Dashboard</h2>
      <p>Bienvenido a tu panel de control de tus Activos Fijos.</p>
    </div>
  );
};

export default Dashboard;
